trans-unit.target:
--logger|/logger:<URI или понятное имя средства ведения журналов>
      Укажите средство ведения журналов для результатов тестирования. Например, для записи результатов
      в файл результатов теста Visual Studio (TRX) используйте /logger:trx [;LogFileName=<по умолчанию: уникальное имя файла>].
      Создает файл в каталоге TestResults с указанным LogFileName.

      Измените уровень детализации для консольного средства ведения журналов. Разрешенные значения для детализации: quiet (отсутствует), minimal (минимальный) и normal (обычный).

      Пример: /logger:console;verbosity=<по умолчанию: "minimal" (минимальный)>

      Для публикации результатов тестов на Team Foundation Server используйте TfsPublisher, как показано ниже.
      Пример: /logger:TfsPublisher;
                Collection=<URL-адрес коллекции командных проектов>;
                BuildName=<название сборки>;
                TeamProject=<название командного проекта>;
                [;Platform=<по умолчанию используется значение Any CPU (Любой ЦП)>];
                [;Flavor=<по умолчанию имеет значение Debug (Отладка)>];
                [;RunTitle=<заголовок>].

alt-trans.target:
--средства ведения журнала | / logger: < Uri средство ведения журнала и FriendlyName >
      Укажите средство ведения журнала для результатов тестов.  Например для регистрации результатов в Visual Studio теста результаты файла (TRX) используется /logger:trx.
      Для публикации результатов тестов на Team Foundation Server, используйте TfsPublisher, как показано ниже
      Пример: /logger:TfsPublisher;
                Коллекция = < командного проекта URL-адрес коллекции >;
                BuildName = < имя >;
                Командный_проект = < имя командного проекта >
                [; Платформа = < по умолчанию используется значение «Любой ЦП» >]
                [; Разновидность = < по умолчанию имеет значение «Debug» >]
                [; RunTitle = < title >]
